import React from 'react'
import Newsletter from '../Newsletter/Newsletter'
import '../Pages/Stylesheet/pricetable.css'
import { Link } from 'react-router-dom'

function PriceTable() {
  return (
   <>
   
   <h1>Price Table</h1>

   <div className="blog-container">
        <ul className='blog-list'>
          <li className='navItems'>
            <Link to="/">Home</Link>
          </li>
          <li className='navItems'>
            <Link to="/price">Price Table</Link>
          </li>
        </ul>
      </div>


<section className="price-area" id="price">
  <div className="container">
    <div className="row">
      <div className="col-lg-12 text-center">
        <div className="rt-section-title-wrapper">
          <h2 className="rt-section-title">Affordable Pricing for All</h2>
          <p>Quality control of your data including read length distribution.</p>
        </div>{/* ./ section title  */}
      </div>{/* ./column */}
    </div>{/* ./row */}
    <div className="spacer-80" />{/* ./ spacer */}
    <div className="row">
      <div className="col-lg-4 mx-auto text-center col-md-6">
        <div className="single-price-table">
          <div className="price-design-elemnts one" />{/* ./elemnts one */}
          <div className="price-design-elemnts two" />{/* ./elemnts two */}
          <div className="price-design-elemnts three" />{/* ./elemnts three */}
          <div className="price-design-elemnts four" />{/* ./elemnts four */}
          <div className="price-header">
            <span className="package-title">Free</span>
            <span className="package-amount">$0<span>/</span><span>mo</span></span>
          </div>{/* ./ price header */}
          <div className="price-body">
            <ul>
              <li>Unlimited Pages</li>
              <li>All Team Members</li>
              <li>Unlimited Leads</li>
              <li>Unlimited Page Views</li>
              <li>Export in HTML/CSS</li>
            </ul>
          </div>{/* ./ price body */}
          <div className="price-footer">
            <a href="#">Get Started</a>
          </div>{/* ./price footer */}
        </div>{/* ./ prioce table */}
      </div>{/* ./ column */}
      <div className="col-lg-4 mx-auto text-center col-md-6">
        <div className="single-price-table">
          <div className="price-design-elemnts one" />{/* ./elemnts one */}
          <div className="price-design-elemnts two" />{/* ./elemnts two */}
          <div className="price-design-elemnts three" />{/* ./elemnts three */}
          <div className="price-design-elemnts four" />{/* ./elemnts four */}
          <div className="price-header">
            <span className="package-title">Startar</span>
            <span className="package-amount">$30<span>/</span><span>mo</span></span>
          </div>{/* ./ price header */}
          <div className="price-body">
            <ul>
              <li>Unlimited Pages</li>
              <li>All Team Members</li>
              <li>Unlimited Leads</li>
              <li>Unlimited Page Views</li>
              <li>Export in HTML/CSS</li>
            </ul>
          </div>{/* ./ price body */}
          <div className="price-footer">
            <a href="#">Get Started</a>
          </div>{/* ./price footer */}
        </div>{/* ./ prioce table */}
      </div>{/* ./ column */}
      <div className="col-lg-4 mx-auto text-center col-md-6">
        <div className="single-price-table">
          <div className="price-design-elemnts one" />{/* ./elemnts one */}
          <div className="price-design-elemnts two" />{/* ./elemnts two */}
          <div className="price-design-elemnts three" />{/* ./elemnts three */}
          <div className="price-design-elemnts four" />{/* ./elemnts four */}
          <div className="price-header">
            <span className="package-title">Premium</span>
            <span className="package-amount">$60<span>/</span><span>mo</span></span>
          </div>{/* ./ price header */}
          <div className="price-body">
            <ul>
              <li>Unlimited Pages</li>
              <li>All Team Members</li>
              <li>Unlimited Leads</li>
              <li>Unlimited Page Views</li>
              <li>Export in HTML/CSS</li>
            </ul>
          </div>{/* ./ price body */}
          <div className="price-footer">
            <a href="#">Get Started</a>
          </div>{/* ./price footer */}
        </div>{/* ./ prioce table */}
      </div>{/* ./ column */}
    </div>{/* ./ row */}
  </div>{/* ./container */}
</section>



   <Newsletter/>
   
   </>
  )
}

export default PriceTable
